--~~~~GLOBALS
function lerp(a,b,t) return (1-t)*a + t*b end

gamestate="menu"

mus="start"

function init()
 deathtimer=0
 
	--gametype="conway"
	gametype="mitosis"
	
	wave=0
	score=0
	mults=1
	
	cam={x=0,y=0}
	
	p={x=0,y=0,vx=0,vy=0,
	   rot=0,dead=false,sct=0}
	
	ptcs={}
	fltxts={}
	ents={}
	
	levelrad=180
	bthick=2
	
	lcells={}
	
	cells={}
	
	cscale = 8
	cellx=200
	celly=200
	
	xoff=200
	yoff=200
	sdensity=3-score/1000
	
	function spawnway()
	 cells={}
		lcells={}
		for j=1,celly do
		 local row = {}
		 for i=1,cellx do 
		  if math.random(0,sdensity)==0 
		  and math.sqrt((i-xoff/cscale)^2+(j-yoff/cscale)^2)>80/cscale then
			   row[i]=1
		  else
		   row[i]=0
		  end
		 end
		 table.insert(cells,row)
		 table.insert(lcells,row)
		end
		
		--wipe out all cells within player circ
		local floor=math.floor
		for i=0,8 do
			for j=0,8 do
				if cells[floor((p.y+(j-4)*cscale)/cscale+yoff/cscale)][floor((p.x+(i-4)*cscale)/cscale+xoff/cscale)]~= nil then
	    if cells[floor((p.y+(j-4)*cscale)/cscale+yoff/cscale)][floor((p.x+(i-4)*cscale)/cscale+xoff/cscale)]==1 then
	     cells[floor((p.y+(j-4)*cscale)/cscale+yoff/cscale)][floor((p.x+(i-4)*cscale)/cscale+xoff/cscale)]=0     
				 end
				end
			end
  end				
	end
	
	spawnway()
	
	gld={{0,1,0},{0,0,1},{1,1,1}}
	
	--this works to spawn glider shape
	for k=1,3 do
	 for v=1,3 do
		 cells[30+k][30+v]=gld[k][v]
		end
	end
	
	lasttime=time()
end

mpxs={}

for i=1,31 do
 table.insert(mpxs,{math.random(0,240),
                   math.random(0,136),
                   math.random(0,3)})
end

init()

function TIC()
 if gamestate=="menu" then
  menu() 
  if mus~="on" then
	  music(1)
	  mus="on"
	 end
 elseif gamestate=="play" then
  play()
 elseif gamestate=="postgame" then
  if mus~="dead" then
	  music(0)
	  mus="dead"
	 end
  postgame()
 end
end

function menu()
 vbank(0)
 cls()
 
 rect(0,0,240,136,5)
 
 for i,mpx in ipairs(mpxs) do
  rect(mpx[2]+math.cos(time()/800+mpx[3])*3+50,mpx[1],8,8,4)
  rect(mpx[2]+math.cos(time()/800+mpx[3])*3+2+50,mpx[1]+2,4,4,5)
 end
 
 for i,mpx in ipairs(mpxs) do
  rect(mpx[1]+math.sin(time()/800+mpx[3])*3,mpx[2],9,9,1)
 
  rect(mpx[1]+math.sin(time()/800+mpx[3])*3,mpx[2],8,8,2)
  rect(mpx[1]+math.sin(time()/800+mpx[3])*3+2,mpx[2]+2,4,4,1)
 end
 
 
 local yf=30
 
 spr(8,76,yf,5,2,0,0,2,2)
 spr(8,100,yf-2,5,2,0,0,2,2)
 spr(8,132,yf,5,2,0,0,2,2)
 
 spr(42,76,0,5,2,5,0,2,2)
 spr(44,126,0,5,2,5,0,2,2)
 
 spr(11,90,yf+10,5,2,0,0,1,2)
 spr(12,126,yf+12,5,2,0,0,1,2)
 
 spr(2,80,yf-10,5,2,0,0,5,2)
 
 cpt("Press Face Button To Start!",110,13,10)
 
 if btnp(4) or btnp(5) 
 or btnp(6) or btnp(7) then
  gamestate = "play"
 end
 
 rectb(0,0,240,136,13)
 
end

function play()

	cam.x=lerp(cam.x,p.x+p.vx-120,0.15)
 cam.y=lerp(cam.y,p.y+p.vy-68,0.15)
	
	cls(0)
	
	circ(-cam.x,-cam.y,levelrad+1,4)
	circ(-cam.x,-cam.y,levelrad,5)
	
	--clip region	
	vbank(1)
	circ(-cam.x,-cam.y,levelrad*2,1)
	circ(-cam.x,-cam.y,levelrad,0)	
	circb(-cam.x,-cam.y,levelrad+3,2)
	circb(-cam.x,-cam.y,levelrad+1,2)	
	
	
	local mc=tonumber(string.format("%.1f",mults)) 	
	local moff=string.len(mc)*6
	rect(208-moff,113,70+moff,10,14)
	rect(207-moff,114,70+moff,8,14)
	rect(208-moff,113,70+moff,10,14)
	bpt("Mult:"..mc,210-moff,115,13,15,1)
	
	
	 
 local sc=tonumber(string.format("%.0f",score)) 
	moff=string.len(sc)*6
	rect(198-moff,123,70+moff,10,14)
	rect(197-moff,124,70+moff,8,14)
	rect(198-moff,123,70+moff,10,14)
	bpt("Score:"..sc,200-moff,125,13,15,1)
	vbank(0)
	
	map(0,17,30,17,
	   -xoff/2-cam.x/6,
				-yoff/2-cam.y/6,5,2)
 
 map(0,34,30,17,
	   -xoff/2-cam.x/4,
				-yoff/2-cam.y/4,5,2)
	
	map(0,0,30,17,
	   -xoff/2-cam.x/2,
				-yoff/2-cam.y/2,5,2)
	
	entlgc()
	
 if gametype == "conway" then
  local framespace = 270-score/400
  if time()-lasttime>framespace then
		 conway()
			lasttime=time()
		end
		condraw()
	elseif gametype == "mitosis" then
	 mitosis()
 end
	
	
	
	player()
	ptclgc()
	fltxtlogic()
	
	vbank(1)
	
	if p.dead ==true then
	 music()
		if deathtimer==0 then
		 sfx(63,"A#2",40,0)
			sfx(63,"D#1",40,1)
		end
		deathtimer=deathtimer+1
		circ(8,49,deathtimer,8)
		circ(100,100,deathtimer/2-20,8)
		circ(120,10,deathtimer/2-20,8)
		circ(200,30,deathtimer/2-5,8)
		circ(220,120,deathtimer-5,8)
		
		if deathtimer>130 then
		 deathtimer=0
		 gamestate="postgame"
		end
	end
	vbank(0)
end

function mitosis()
 if mitspawn==nil then
  mitwave()
  mitspawn=true
 end
end

function mitwave()
 local total=6
 local pi=math.pi
 for r=0,total do 
  sp_ent(2*levelrad*math.cos(2*pi*r/total)/2,
         2*levelrad*math.sin(2*pi*r/total)/2,
         "split",{health=10,size=3})
 end
end

function conway()
 local cellcount=0
 local floor = math.floor
 
 for j=1,celly do
  for i=1,cellx do
   lcells[j][i]=cells[j][i]
   cellcount = cellcount+lcells[j][i]
  end
 end
 
 for j=1,celly do
  for i=1,cellx do 
   --delete all cells outside of bounds
   if math.sqrt((i-xoff/cscale)^2+(j-yoff/cscale)^2)<levelrad/cscale-bthick then
	   local nb=0
	   if j~=1 and j~=celly
	   and i~=1 and i~=cellx then
	    nb=nb+lcells[j-1][i+0]
			  nb=nb+lcells[j+1][i+0]
					
					nb=nb+lcells[j+0][i-1]
					nb=nb+lcells[j+0][i+1]
					
					nb=nb+lcells[j+1][i-1]
					nb=nb+lcells[j+1][i+1]
					nb=nb+lcells[j-1][i-1]
					nb=nb+lcells[j-1][i+1]
				end
	   
				local propagate = 3

				if nb==propagate then
				 cells[j][i]=1
				elseif nb==propagate-1 then
				 cells[j][i]=lcells[j][i]
				else
				 cells[j][i]=0
				end
			else
			 cells[j][i]=0
			end
  end
 end
 
 --this works
 if cellcount<1 then
  spawnway()
 end
 
	if cells[floor(p.y/cscale+yoff/cscale)][floor(p.x/cscale+xoff/cscale)]==1 then
  p.dead=true
	end
end

function condraw()
 
 --draw cells
	for j=1,celly do
	 for i=1,cellx do 
			if lcells[j][i]==1 then
			 rect(i*cscale-1-cam.x-xoff,
				     j*cscale-1-cam.y-yoff,cscale+3,cscale+3,13)
			end
	 end
	end
	
	for j=1,celly do
	 for i=1,cellx do 
			if lcells[j][i]==1 then
			 rect(i*cscale+1-cam.x-xoff,
				     j*cscale-cam.y-yoff,cscale,cscale,1)
				rect(i*cscale-cam.x-xoff,
				     j*cscale+1-cam.y-yoff,cscale,cscale,1)
			end
			if cells[j][i]==1 then
			 rect(i*cscale-cam.x-xoff,
				     j*cscale-cam.y-yoff,cscale,cscale,2)
			 rect(i*cscale-cam.x-xoff+2,
				     j*cscale-cam.y-yoff+2,cscale/2,cscale/2,1)
			
			end
	 end
	end
end

function player()
 local pi=math.pi
	local sang=nil
	local scap = 2.5
	local fric = 0.8
	if p.dead == false then
		--player control
		if btn(0) and p.vy>-scap then
		 p.vy = p.vy-0.5
		elseif btn(1) and p.vy<scap then
		 p.vy = p.vy+0.5
		else
		 p.vy = p.vy*fric
		end
		if btn(2) and p.vx>-scap then
		 p.vx = p.vx-0.5
		elseif btn(3) and p.vx<scap then
		 p.vx = p.vx+0.5
		else
		 p.vx = p.vx*fric
		end
		
		if math.sqrt(p.x^2+p.y^2)>levelrad-15 then
		 p.vx=p.vx-2*p.x/levelrad
			p.vy=p.vy-2*p.y/levelrad
		end
		
		local floor = math.floor
		
		--there's got to be a better way!!

		if btn(7) and btn(5) then
		 sang = 7*pi/4
		elseif btn(6) and btn(7) then
		 sang = 5*pi/4
		elseif btn(6) and btn(4) then
		 sang = 3*pi/4
		elseif btn(4) and btn(5) then
		 sang = pi/4
		elseif btn(4) then
		 sang = pi/2
		elseif btn(7) then
		 sang = 3*pi/2
		elseif btn(5) then
		 sang = 0
		elseif btn(6) then
		 sang = pi
		end

  p.sct=p.sct+1

		if sang~= nil then	
		 p.rot=sang		
			
			local count = 1+floor(score/50000)
		 if p.sct >= 12 then	
			 for i=-count,count do
				 local r = math.random(-2,2)*pi/50
			  sp_ptc(p.x,--x
           p.y,--y
											math.cos(p.rot+pi/15*i+r)*3,--vx
											math.sin(p.rot+pi/15*i+r)*3,--vy
           100,--life
           1,--dmg
           1,--rad
           13)--colour
				end
				p.sct=0
			end
		end
		
		p.x=p.x+p.vx
		p.y=p.y+p.vy
		
		circ(p.x-cam.x,p.y-cam.y,4.5,13)
		circ(p.x-cam.x,p.y-cam.y,3.5,14)
		
		line(floor(p.x-cam.x),floor(p.y-cam.y),
		     floor(p.x-cam.x+2*math.cos(p.rot)),
							floor(p.y-cam.y+2*math.sin(p.rot)),15)
	end
end

function postgame()
 vbank(0)
 cls(1)
 if deathtimer<80 then
  deathtimer=deathtimer+1
 end
 
 local off=deathtimer-80
 
 cpt("Experiment Concluded",10+off,0,5,2)
 
 local mc=tonumber(string.format("%.1f",mults)) 
 cpt("Multiplier: "..mc,60+off,0,5)
 
 local sc=tonumber(string.format("%.1f",score)) 
 cpt("Score: "..sc,70+off,0,5)
 
 cpt("Press any face button to return to menu",100-off,0,5)

 if btnp(4) or btnp(5) 
 or btnp(6) or btnp(7) then
  init()
  gamestate = "menu"
 end
 
 vbank(1)
 cls()
 
 
end

function sp_ptc(x,y,vx,vy,l,dmg,r,c)
 ptc={
  x=x,y=y,vx=vx,vy=vy,
  l=l,dmg=dmg,r=r,c=c
 }
 
 table.insert(ptcs,ptc)
end

function ptclgc()
	for i,ptc in ipairs(ptcs) do
		ptc.x = ptc.x + ptc.vx
		ptc.y = ptc.y + ptc.vy 
		
		ptc.l=ptc.l-1
		if ptc.l<0 then
		 table.remove(ptcs,i)
		end
		
		if gametype == "mitosis" then		
		 if ptc.dmg>0 then
	   for b,ent in ipairs(ents) do
				 if ents[b].ty=="split" then
					 if ptc.x>ents[b].x-2*ents[b].e.size
						and ptc.x<ents[b].x+2*ents[b].e.size
						and ptc.y>ents[b].y-2*ents[b].e.size
						and ptc.y<ents[b].y+2*ents[b].e.size then
							
							ents[b].e.health=ents[b].e.health-1
							table.remove(ptcs,i)
						end
					end				
				end
			end
			
		elseif gametype == "conway" then
	 	if ptc.dmg>0 then
				if ptc.y<-levelrad+10 then
				 table.remove(ptcs,i)
				elseif ptc.y>-levelrad+15 then
				 local floor = math.floor
					if cells[floor(ptc.y/cscale+yoff/cscale)][floor(ptc.x/cscale+xoff/cscale)]==1 then
				  
						splat(ptc.x,ptc.y,1,3)
						sp_fltxt(ptc.x,ptc.y,15,14,"+1",30)
						sp_ent(ptc.x,ptc.y,"mult")
						score=score+1*mults
						
						sfx(56,math.random(40,50),4,3,
						    math.random(4,6))
						
						table.remove(ptcs,i)
						cells[floor(ptc.y/cscale+yoff/cscale)][floor(ptc.x/cscale+xoff/cscale)]=0
					 lcells[floor(ptc.y/cscale+yoff/cscale)][floor(ptc.x/cscale+xoff/cscale)]=0 
					end
				end
			end
  end
  
		if ptc.r>0 then
		 if ptc.dmg>0 then
			 circ(ptc.x-cam.x,ptc.y-cam.y,ptc.r+1,0)
			end
			circ(ptc.x-cam.x,ptc.y-cam.y,ptc.r,ptc.c)
		else
		 pix(ptc.x-cam.x,ptc.y-cam.y,ptc.c)
		end
	end
end

function splat(x,y,r,c)
 for i=0,12 do
	 sp_ptc(x,
	       y,
								math.random(-3,3),--vx
								math.random(-3,3),--vy
	       30,--life
	       0,--dmg
	       r,--rad
	       c)
 end
end
--background print text
function bpt(s,x,y,c,m,b)
 for i=0,8 do
	 print(s,x-1+i%3,y-1+i//3,c,false,b)
	end
 print(s,x,y,m,false,b)
end

--center print text 
function cpt(s,y,c,m,b)
 if not b then b=1 end
	local w=print(s,0,-6)*b
	local p=(240-w)//2
	local f=false
 bpt(s,p,y,c,m,b)
end

function sp_fltxt(x,y,c1,c2,m,l)
 fltxt = {x=x,y=y,c1=c1,m=m,l=l,c2=c2}
 table.insert(fltxts,fltxt)
end

function fltxtlogic()
 for i,fltxt in ipairs(fltxts) do
  fltxt.l = fltxt.l-1
  fltxt.y = fltxt.y-0.5
  if fltxt.l <0 then 
   table.remove(fltxts,i)
  end  
	 bpt(fltxt.m,fltxt.x-cam.x,fltxt.y-cam.y,fltxt.c2,fltxt.c1,1)
	end
end

function pyth(x,y)
 return math.sqrt(x^2+y^2)
end

function sp_ent(x,y,ty,e)
 if not e then e=nil end
 ent={x=x,y=y,ty=ty,e=e}
 table.insert(ents,ent)
end

function entlgc()
 for i,ent in ipairs(ents) do 
  local ty_l=ent.ty.."_l"
  entfuncs[ty_l](i)
	end
end

entfuncs={}

function entfuncs.mult_l(id)
 local pi=math.pi
	local vecx = ents[id].x+4-p.x
	local vecy = ents[id].y+4-p.y
	local ang = math.atan(vecy,vecx)+pi/2
	
	ents[id].x = ents[id].x-(vecx/math.abs(vecx))*(math.abs(vecx)*20/pyth(vecx,vecy)^2)
	ents[id].y = ents[id].y-(vecy/math.abs(vecy))*(math.abs(vecy)*20/pyth(vecx,vecy)^2)

 if ents[id].x+6>p.x-3 
 and ents[id].x<p.x+3
 and ents[id].y+6>p.y-3
 and ents[id].y<p.y-3 then
  table.remove(ents,id)
  mults=mults+0.1
 end
 spr(336+(time()/100)%12,ent.x-cam.x,ent.y-cam.y,0)
end

function entfuncs.split_l(id)
 local pi=math.pi
 local size=ents[id].e.size
	local vecx = ents[id].x-p.x+math.random(-20,20)
	local vecy = ents[id].y-p.y+math.random(-20,20)

	ents[id].x = ents[id].x-(vecx/pyth(vecx,vecy))/size
	ents[id].y = ents[id].y-(vecy/pyth(vecx,vecy))/size
 
 if ents[id].e.health <=0 then
 	if ents[id].e.size==3
  or ents[id].e.size==2 then
   local es={health=3*ents[id].e.size,
             size=ents[id].e.size-1}
            
   sp_ent(ents[id].x-2*ents[id].e.size,
          ents[id].y-2*ents[id].e.size,
          "split",es)

   sp_ent(ents[id].x+2*ents[id].e.size,
          ents[id].y-2*ents[id].e.size,
          "split",es)
   
   sp_ent(ents[id].x-2*ents[id].e.size,
          ents[id].y+2*ents[id].e.size,
          "split",es)
   
   sp_ent(ents[id].x+2*ents[id].e.size,
          ents[id].y+2*ents[id].e.size,
          "split",es)
  end
  splat(ents[id].x,ents[id].y,1,3)
  splat(ents[id].x,ents[id].y,1,3)
  sp_ent(ents[id].x,ents[id].y,"mult")
  score=score+ents[id].e.size*mults
  table.remove(ents,id)
  return
 end

 local sin=math.sin
 local cos=math.cos
 local t=time()/100

	if ents[id].e.size==1 then
	 spr(131+t%4,
	     ents[id].x-cam.x-4,
	     ents[id].y-cam.y-4,5)
 elseif ents[id].e.size==2 then
  spr(160+t//2%4*2,
     ents[id].x-cam.x-8,
     ents[id].y-cam.y-8,5,1,0,0,2,2)
 else
  spr(192+t//2%4*4,
     ents[id].x-cam.x-16,
     ents[id].y-cam.y-16,5,1,0,0,4,4)
 end
end
